define("ckeditor/plugins/a11yhelp/lang/nb",["dijit","dojo","dojox"],function(){CKEDITOR.plugins.setLang("a11yhelp","nb",{accessibilityHelp:{title:"Instruksjoner for tilgjengelighet",contents:"Innhold for hjelp. Trykk ESC for \u00e5 lukke denne dialogen.",legend:[{name:"Generelt",items:[{name:"Verkt\u00f8ylinje for editor",legend:"Trykk ${toolbarFocus} for \u00e5 navigere til verkt\u00f8ylinjen. Flytt til neste og forrige verkt\u00f8ylinjegruppe med TAB og SHIFT-TAB. Flytt til neste og forrige verkt\u00f8ylinjeknapp med H\u00d8YRE PILTAST og VENSTRE PILTAST. Trykk MELLOMROM eller ENTER for \u00e5 aktivere verkt\u00f8ylinjeknappen."},
{name:"Dialog for editor",legend:"Mens du er i en dialog, trykk TAB for \u00e5 navigere til neste dialogfelt, press SHIFT + TAB for \u00e5 flytte til forrige felt, trykk ENTER for \u00e5 akseptere dialogen, trykk ESC for \u00e5 avbryte dialogen. For dialoger med flere faner, trykk ALT + F10 for \u00e5 navigere til listen over faner. G\u00e5 til neste fane med TAB eller H\u00d8YRE PILTAST. G\u00e5 til forrige fane med SHIFT + TAB eller VENSTRE PILTAST. Trykk MELLOMROM eller ENTER for \u00e5 velge fanen."},
{name:"Kontekstmeny for editor",legend:"Trykk ${contextMenu} eller MENYKNAPP for \u00e5 \u00e5pne kontekstmeny. G\u00e5 til neste alternativ i menyen med TAB eller PILTAST NED. G\u00e5 til forrige alternativ med SHIFT+TAB eller PILTAST OPP. Trykk MELLOMROM eller ENTER for \u00e5 velge menyalternativet. \u00c5pne undermenyen p\u00e5 valgt alternativ med MELLOMROM eller ENTER eller H\u00d8YRE PILTAST. G\u00e5 tilbake til overordnet menyelement med ESC eller VENSTRE PILTAST. Lukk kontekstmenyen med ESC."},
{name:"Listeboks for editor",legend:"I en listeboks, g\u00e5 til neste alternativ i listen med TAB eller PILTAST NED. G\u00e5 til forrige alternativ i listen med SHIFT + TAB eller PILTAST OPP. Trykk MELLOMROM eller ENTER for \u00e5 velge alternativet i listen. Trykk ESC for \u00e5 lukke listeboksen."},{name:"Verkt\u00f8ylinje for elementsti",legend:"Trykk ${elementsPathFocus} for \u00e5 navigere til verkt\u00f8ylinjen som viser elementsti. G\u00e5 til neste elementknapp med TAB eller H\u00d8YRE PILTAST. G\u00e5 til forrige elementknapp med SHIFT+TAB eller VENSTRE PILTAST. Trykk MELLOMROM eller ENTER for \u00e5 velge elementet i editoren."}]},
{name:"Kommandoer",items:[{name:"Angre",legend:"Trykk ${undo}"},{name:"Gj\u00f8r om",legend:"Trykk ${redo}"},{name:"Fet tekst",legend:"Trykk ${bold}"},{name:"Kursiv tekst",legend:"Trykk ${italic}"},{name:"Understreking",legend:"Trykk ${underline}"},{name:"Link",legend:"Trykk ${link}"},{name:"Skjul verkt\u00f8ylinje",legend:"Trykk ${toolbarCollapse}"},{name:"Hjelp for tilgjengelighet",legend:"Trykk ${a11yHelp}"}]}]}})});